import { useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';

function AdminDashboard() {
  const [searchTerm, setSearchTerm] = useState('');
  const [activeTab, setActiveTab] = useState('users'); // users, listers, listings

  // Mock data - replace with actual API calls
  const mockData = {
    users: [
      { 
        id: 1, 
        username: "alexj", 
        name: "Alex Johnson",
        traits: {
          smoking: "non-smoking",
          drinking: "social-drinking",
          pets: "no-pets",
          genderPreference: "any"
        }
      },
      { 
        id: 2, 
        username: "sarahs", 
        name: "Sarah Smith",
        traits: {
          smoking: "smoking",
          drinking: "non-drinking",
          pets: "has-pets",
          genderPreference: "female-only"
        }
      },
    ],
    listers: [
      { 
        id: 1, 
        username: "pmllc",
        name: "Peter Miller", 
        listings: [
          { id: 1, title: "Sunset Apartments 2B" },
          { id: 2, title: "Lakeside View 101" }
        ]
      },
      { 
        id: 2, 
        username: "jsmith",
        name: "John Smith", 
        listings: [
          { id: 3, title: "Campus View 305" }
        ]
      },
    ],
    listings: [
      { 
        id: 1, 
        title: "Sunset Apartments 2B", 
        address: "123 College Ave", 
        price: 1200, 
        lister: "Peter Miller",
        listerId: 1
      },
      { 
        id: 2, 
        title: "Campus View 305", 
        address: "456 University St", 
        price: 1500, 
        lister: "John Smith",
        listerId: 2
      },
    ],
  };

  const handleRemove = (type, id) => {
    // Implement removal logic here
    console.log(`Removing ${type} with ID: ${id}`);
    // Show confirmation modal and make API call
  };

  const renderContent = () => {
    const filteredData = mockData[activeTab].filter(item => {
      const searchTermLower = searchTerm.toLowerCase();

      if (activeTab === 'listings') {
        return (
          item.title.toLowerCase().includes(searchTermLower) ||
          item.address.toLowerCase().includes(searchTermLower) ||
          item.lister.toLowerCase().includes(searchTermLower)
        );
      }

      return (
        item.username.toLowerCase().includes(searchTermLower) ||
        item.name.toLowerCase().includes(searchTermLower)
      );
    });

    return (
      <div className="overflow-x-auto">
        <table className="w-full">
          <thead>
            <tr className="bg-gray-50">
              {activeTab === 'users' && (
                <>
                  <th className="px-6 py-3 text-left text-sm font-semibold text-gray-600">Username</th>
                  <th className="px-6 py-3 text-left text-sm font-semibold text-gray-600">Name</th>
                  <th className="px-6 py-3 text-left text-sm font-semibold text-gray-600">Traits</th>
                  <th className="px-6 py-3 text-left text-sm font-semibold text-gray-600">Actions</th>
                </>
              )}
              {activeTab === 'listers' && (
                <>
                  <th className="px-6 py-3 text-left text-sm font-semibold text-gray-600">Username</th>
                  <th className="px-6 py-3 text-left text-sm font-semibold text-gray-600">Name</th>
                  <th className="px-6 py-3 text-left text-sm font-semibold text-gray-600"># of Listings</th>
                  <th className="px-6 py-3 text-left text-sm font-semibold text-gray-600">Actions</th>
                </>
              )}
              {activeTab === 'listings' && (
                <>
                  <th className="px-6 py-3 text-left text-sm font-semibold text-gray-600">Title</th>
                  <th className="px-6 py-3 text-left text-sm font-semibold text-gray-600">Address</th>
                  <th className="px-6 py-3 text-left text-sm font-semibold text-gray-600">Price</th>
                  <th className="px-6 py-3 text-left text-sm font-semibold text-gray-600">Lister</th>
                  <th className="px-6 py-3 text-left text-sm font-semibold text-gray-600">Actions</th>
                </>
              )}
            </tr>
          </thead>
          <tbody className="divide-y divide-gray-200">
            {filteredData.map((item) => (
              <tr key={item.id} className="bg-white hover:bg-gray-50">
                {activeTab === 'users' && (
                  <>
                    <td className="px-6 py-4 text-sm text-gray-900">{item.username}</td>
                    <td className="px-6 py-4 text-sm text-gray-900">{item.name}</td>
                    <td className="px-6 py-4 text-sm text-gray-900">
                      <div className="flex flex-wrap gap-2">
                        {Object.entries(item.traits).map(([key, value]) => (
                          <span key={key} className="px-2 py-1 bg-blue-50 text-blue-600 rounded-full text-xs">
                            {value}
                          </span>
                        ))}
                      </div>
                    </td>
                  </>
                )}
                {activeTab === 'listers' && (
                  <>
                    <td className="px-6 py-4 text-sm text-gray-900">{item.username}</td>
                    <td className="px-6 py-4 text-sm text-gray-900">{item.name}</td>
                    <td className="px-6 py-4 text-sm text-gray-900">{item.listings.length}</td>
                  </>
                )}
                {activeTab === 'listings' && (
                  <>
                    <td className="px-6 py-4 text-sm text-gray-900">{item.title}</td>
                    <td className="px-6 py-4 text-sm text-gray-900">{item.address}</td>
                    <td className="px-6 py-4 text-sm text-gray-900">${item.price}</td>
                    <td className="px-6 py-4 text-sm text-gray-900">{item.lister}</td>
                  </>
                )}
                <td className="px-6 py-4 text-sm">
                  <button
                    onClick={() => handleRemove(activeTab, item.id)}
                    className="text-red-600 hover:text-red-900 font-medium"
                  >
                    Remove
                  </button>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    );
  };

  return (
    <div className="min-h-screen bg-gray-50">
      {/* Header */}
      <div className="bg-gradient-to-br from-blue-600 via-blue-700 to-indigo-800 pt-8 pb-24">
        <div className="container mx-auto px-6">
          <div className="flex justify-between items-center mb-8">
            <Link 
              to="/home" 
              className="inline-flex items-center text-white hover:text-blue-100 transition-colors"
            >
              <svg className="w-5 h-5 mr-2" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M15 19l-7-7 7-7" />
              </svg>
              Back to Home
            </Link>
            <Link 
              to="/admin/profile" 
              className="inline-flex items-center text-white hover:text-blue-100 transition-colors"
            >
              <svg className="w-5 h-5 mr-2" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M16 7a4 4 0 11-8 0 4 4 0 018 0zM12 14a7 7 0 00-7 7h14a7 7 0 00-7-7z" />
              </svg>
              My Profile
            </Link>
          </div>
          <h1 className="text-4xl font-bold text-white mb-4">Admin Dashboard</h1>
          <p className="text-xl text-blue-100">Manage users, listers, and listings</p>
        </div>
      </div>

      {/* Main Content */}
      <div className="container mx-auto px-6 -mt-16">
        <div className="bg-white rounded-2xl shadow-xl p-8">
          {/* Tabs */}
          <div className="flex space-x-4 mb-6">
            {['users', 'listers', 'listings'].map((tab) => (
              <button
                key={tab}
                onClick={() => setActiveTab(tab)}
                className={`px-4 py-2 rounded-lg font-medium ${
                  activeTab === tab
                    ? 'bg-blue-600 text-white'
                    : 'text-gray-600 hover:bg-gray-100'
                }`}
              >
                {tab.charAt(0).toUpperCase() + tab.slice(1)}
              </button>
            ))}
          </div>

          {/* Search */}
          <div className="mb-6">
            <input
              type="text"
              placeholder={`Search ${activeTab}...`}
              value={searchTerm}
              onChange={(e) => setSearchTerm(e.target.value)}
              className="w-full px-4 py-2 border border-gray-300 rounded-lg focus:ring-2 focus:ring-blue-500 focus:border-blue-500"
            />
          </div>

          {/* Content */}
          {renderContent()}
        </div>
      </div>
    </div>
  );
}

export default AdminDashboard;
